import wdioEslint, { globals } from '@wdio/eslint'

export default wdioEslint.config([
    {
        /**
         * Eslint ignore patterns for the whole project
         */
        ignores: [
            'packages/**/build',
            'packages/**/cjs',
            'packages/**/node_modules',
            'packages/node_modules',
            'packages/**/coverage',
            'tests/typings',
            '**/*.d.ts',
            'packages/wdio-protocols/src/protocols/webdriverBidi.ts',
            'packages/webdriverio/third_party/fake-timers.js',
            'packages/wdio-protocols/src/commands'
        ],
    },
    {
        /**
         * Eslint rules for /example directory and unit tests
         */
        files: [
            'examples/**/*.ts',
            'examples/**/*.js',
            'packages/**/*.test.ts',
            'packages/**/tests/**/*.ts'
        ],
        languageOptions: {
            globals: {
                ...globals.mocha,
                ...globals.jasmine,
                browser: true,
                $: true
            }
        },
        rules: {
            'no-undef': 'off',
            'no-unused-vars': 'off',
            '@typescript-eslint/no-unused-vars': 'off',
            '@typescript-eslint/no-explicit-any': 'off',
            'wdio/no-pause': 'off',
            'wdio/no-debug': 'off',
        }
    },
    {
        /**
         * Eslint rules for /tests folder
         */
        files: [
            'tests/**/*.ts',
            'tests/**/*.js',
        ],
        languageOptions: {
            globals: {
                ...globals.mocha,
                ...globals.jasmine,
                browser: true,
                $: true
            }
        },
        rules: {
            'dot-notation': 'off',
            'wdio/no-pause': 'off',
            'wdio/no-debug': 'off',
            '@typescript-eslint/no-explicit-any': 'off',
            '@typescript-eslint/no-require-imports': 'off',
        }
    }
])

{
  "$schema": "node_modules/lerna/schemas/lerna-schema.json",
  "packages": [
    "packages/*"
  ],
  "npmClient": "pnpm",
  "version": "9.5.5",
  "command": {
    "bootstrap": {
      "npmClientArgs": [
        "--no-package-lock",
        "--include=dev"
      ]
    }
  },
  "changelog": {
    "repo": "webdriverio/webdriverio",
    "cacheDir": ".changelog",
    "labels": {
      "PR: Spec Compliancy :eyeglasses:": ":eyeglasses: Spec Compliancy",
      "PR: Breaking Change :boom:": ":boom: Breaking Change",
      "PR: New Feature :rocket:": ":rocket: New Feature",
      "PR: Bug Fix :bug:": ":bug: Bug Fix",
      "PR: Polish :nail_care:": ":nail_care: Polish",
      "PR: Docs :memo:": ":memo: Documentation",
      "PR: Internal :house:": ":house: Internal"
    }
  }
}

import { defineConfig } from 'vitest/config'

export default defineConfig({
    test: {
        dangerouslyIgnoreUnhandledErrors: true,
        include: ['packages/**/*.test.ts'],
        /**
         * not to ESM ported packages
         */
        exclude: [
            'dist', '.idea', '.git', '.cache',
            '**/node_modules/**',
            'packages/eslint-plugin-wdio/**/*'
        ],
        env: {
            WDIO_SKIP_DRIVER_SETUP: '1'
        },
        coverage: {
            enabled: false,
            provider: 'v8',
            exclude: [
                '**/__mocks__/**',
                '**/build/**',
                '**/cjs/*.ts',
                '**/*.test.ts',
                'packages/webdriver/src/bidi/handler.ts'
            ],
            watermarks: {
                statements: [85, 90],
                functions: [83, 88],
                branches: [85, 90],
                lines: [85, 90]
            }
        },
        setupFiles: [
            '__mocks__/fetch.ts'
        ]
    }
})
